  const message = {
   	id: '1',
	  text: 'Mensagem de teste do nosso app',
	  user:{
		  name: 'Rubens',
		  avatar_url: 'https://github.com/rubenslemos.png'
	  }
  }
  return (
    <ScrollView
      style={styles.container}
      contentContainerStyle={styles.content}
      keyboardShouldPersistTaps= "never"
